import React, {Component} from 'react'
import './App.css';
import Navigation from './Component/Navigation/Navigations';
import Routes from './Component/Routes';
class App extends Component{


  render(){
    return(
      <div className="app">
      <div className="header">
     <Navigation />
     <Routes />
     </div>
    <div className="footer">
    Hello
    </div>
      </div>

    );
  }
}
export default App;
